import React from 'react'
import './View.scss'
const FindClassView = ({ classroomList }) => {
    return (
        <ul>
            {
                classroomList.filter(value => {
                    if (searchTerm.trim() === "") {
                      return value;
                    } else if (
                      value.name.toLowerCase().includes(searchTerm.toLowerCase())
                    ) {
                      return value;
                    }
                  }).map((item, index) =>
                    <div key={index}>
                        <li key={index}>
                            <p>Giáo viên: {item.id_teachers}</p>

                            <p> </p>
                        </li>
                    </div>
                )
            }
        </ul>
    )
}
export default FindClassView;
